import axios from "axios";

// Make sure the URL matches your backend URL
const API_URL = "http://localhost:4000/api/matches";

export const matchService = {
  createMatch: async (duration) => {
    const response = await axios.post(`${API_URL}/create`, { duration });
    return response.data;
  }
};
